sourcesContent:
import styled from "styled-components";


export const HeaderStyled = styled.header`
  width: 100%;
  height: 60px;
  background-color: black;
  color: #fff;
  display: flex;
  align-items: center;
  justify-content: space-between;
  padding: 20px;
  button{
    cursor: pointer;
    border: none;
    background-color: black;
    padding: 10px;
    font-size: 20px;
    color: #fff;
    font-weight: 300;
  }
`
